def get_error_mean(dataset, attn):
    if dataset == 'nasa':
        a, b, c = get_data(dataset, attn)
        a_new = [a_i - (a_i + b_i + c_i) / 3 for a_i, b_i, c_i in zip(a, b, c)]
        b_new = [b_i - (a_i + b_i + c_i) / 3 for a_i, b_i, c_i in zip(a, b, c)]
        c_new = [c_i - (a_i + b_i + c_i) / 3 for a_i, b_i, c_i in zip(a, b, c)]
        return a_new, b_new, c_new

    elif dataset == 'MIT':
        a, b = get_data(dataset, attn)
        a_new = [a_i - (a_i + b_i) / 2 for a_i, b_i in zip(a, b)]
        b_new = [b_i - (a_i + b_i) / 2 for a_i, b_i in zip(a, b)]
        return a_new, b_new

    elif dataset == 'Oxford':
        a, b, c, d, e = get_data(dataset, attn)
        a_new = [a_i - (a_i + b_i + c_i + d_i + e_i) / 5 for a_i, b_i, c_i, d_i, e_i in zip(a, b, c, d, e)]
        b_new = [b_i - (a_i + b_i + c_i + d_i + e_i) / 5 for a_i, b_i, c_i, d_i, e_i in zip(a, b, c, d, e)]
        c_new = [c_i - (a_i + b_i + c_i + d_i + e_i) / 5 for a_i, b_i, c_i, d_i, e_i in zip(a, b, c, d, e)]
        d_new = [d_i - (a_i + b_i + c_i + d_i + e_i) / 5 for a_i, b_i, c_i, d_i, e_i in zip(a, b, c, d, e)]
        e_new = [e_i - (a_i + b_i + c_i + d_i + e_i) / 5 for a_i, b_i, c_i, d_i, e_i in zip(a, b, c, d, e)]
        return a_new, b_new, c_new, d_new, e_new


def get_max_num(dataset, attn):
    if dataset == 'nasa':
        a, b, c = get_data(dataset, attn)
        a_max = 0
        b_max = 0
        c_max = 0

        for a_i, b_i, c_i in zip(a, b, c):
            if a_i > b_i and a_i > c_i:
                a_max += 1
            elif b_i > a_i and b_i > c_i:
                b_max += 1
            elif c_i > a_i and c_i > b_i:
                c_max += 1

        print(a_max, b_max, c_max)
    elif dataset == 'MIT':
        a, b = get_data(dataset, attn)
        a_max = 0
        b_max = 0

        for a_i, b_i in zip(a, b):
            if a_i > b_i:
                a_max += 1
            elif b_i > a_i:
                b_max += 1

        print(a_max, b_max)
